// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div className="container-fluid text-center">
                    {/* My Profile Picture */}
                    <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                    {/* Dive Deep Label */}
                    <div className="row">
                        <p className="text-white lead">Dive Deeper!</p>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
